import TodoItem from "./TodoItem";

const TodoListUl = styled.ul`
  flex: 1;
  padding: 20px;
  background-color: lightgreen;
`;

export default function TodoList() {
  return (
    <>
      <TodoListUl>
        <TodoItem done={true}>맛있는 저녁 먹기</TodoItem>
      </TodoListUl>
    </>
  );
}
